import Link from 'next/link'
import React, { useState } from 'react';
import styles from "../styles/success.module.scss"
import EmailForm from "../../components/EmailForm"

function Success() {

/**
 * EmailForm modal
 */

const [isVisible, setIsVisible] = useState(false);

const showModal = () => {
    setIsVisible(true)
}

const hideModal = () => {
    setIsVisible(false)
}

    return(
        <div className={styles.pageContainer}>
            <img src="https://www.fashionmuseumriga.lv/bitrix/templates/main_template/img/logo.png" alt="logo" id={styles.MMlogo}/>
            <Link href="/client/languages">Done</Link>
            <button type="button" onClick={showModal}>Share Your Results</button>
            <EmailForm 
                show={isVisible}
                hideModal={hideModal}
            />
        </div>
    );
}

export default Success
